import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import "./Service.css";

const Service = () => {
  const services = [
    {
      title: "Instant Consultation",
      img: "../../asset/image/instant_consultation.jpg",
    },
    {
      title: "Book an Appointment",
      img: "../../asset/image/book_appointment.jpg",
    },
    { title: "Self Checkup", img: "../../asset/image/self_check.jpg" },
    { title: "Health Tips and Guidance", img: "../../asset/image/tips.jpg" },
  ];
  return (
    <section className="service-section">
      <h2>Best Services</h2>
      <p>Take care of your body. Itâ€™s the only place you have to live.</p>
      <div className="row justify-content-center mt-4">
        {services.map((service, index) => (
          <section className="service-section">
            <div key={index} className="col-md-3 col-sm-6 mb-4">
              <div className="card service-card shadow-sm">
                <img
                  src={service.img}
                  alt={service.title}
                  className="card-img-top"
                />
                <div className="card-body text-center">
                  <h5 className="card-title text-dark">{service.title}</h5>
                </div>
              </div>
            </div>
          </section>
        ))}
      </div>
    </section>
  );
};

export default Service;
